
public class staticExam {
	public static void hello() {
		System.out.println("Hello");
	}
	public void world() {
		System.out.println("World");
	}
	public static void main(String[] args) {
		// TODO Auto-generated method stub
		hello();
		staticExam obj=new staticExam();
		obj.world();
		obj.hello();
	}

}
